■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">キダチアロエやヒアルロン酸などを配合したゲルマテープです。お肌が敏感な方でもお使いいただけます。撥水加工がしてあるので、汗・水に強く、重ね貼りも大丈夫です!日本製です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">幅:5cm、長さ:5m</font><br><font color="#333333" size="-1">個装サイズ：8×6×8cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">74g</font><br><font color="#333333" size="-1">個装重量：88g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">綿・スパンデックス<br>(西洋イラクサ、キダチアロエ、有機ゲルマニウム、セラミック、トルマリン、ヒアルロン酸配合)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
/*買い物かごに入れるボタン*/
div#rakutenLimitedId_aroundCart input.rCartBtn, 
div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"] {
    width: 330px !important;
    height: 80px !important;
    cursor: pointer !important;
    background: url("http://image.rakuten.co.jp/yoimonohonpo/cabinet/03133889/imgrc0068400933.jpg")no-repeat 0 0 !important;
}

div#rakutenLimitedId_aroundCart input.rCartBtn,
div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"]:hover {
    background: url("http://image.rakuten.co.jp/yoimonohonpo/cabinet/03133889/imgrc0068400934.jpg")no-repeat 0 0 !important;
}
</style>

■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">つらい部分や筋肉にに沿って貼るだけの手軽さです。湿布のような薬剤は使わずゲルマニウムや湯の花、チタンなどを練り込んだテープです。貼ったままお風呂に入れ、かぶれたりしない方は、3日程貼っていても大丈夫です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">幅:5cm、長さ:5m</font><br><font color="#333333" size="-1">個装サイズ：8×6×8cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">74g</font><br><font color="#333333" size="-1">個装重量：88g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">綿、スパンデックス<br>(湯の花・チタン・ゲルマニウム・トルマリン・ヒアルロン酸・セラミック配合)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
