■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ゲルマニウム・トルマリン・セラミック・ヒアルロン酸を配合したゲルマテープです。ひざやふくらはぎ、肩などの体のつらいところに貼るだけ。通気性があるのでかぶれにくく、撥水処理により汗・水に強いです。日本製です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">幅:5cm、長さ:5m</font><br><font color="#333333" size="-1">個装サイズ：8×6×8cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">74g</font><br><font color="#333333" size="-1">個装重量：88g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">綿・スパンデックス<br>(ゲルマニウム・トルマリン・セラミック・ヒアルロン酸配合)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
