■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">なで肩だと太って丸く見える、服がずり落ちやすい、顔が大きく見える、などのマイナス面が。『肩パット付肩甲骨サポーター』なら、着るだけでシャープなシルエットに！肩パットはアウターに合わせて取り外しできる。胸元にはレースのちら見え防止付き。背中のパワーネットで肩甲骨を無理なく伸ばす。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">適応サイズ（バスト）：79～87cm（M）、86～94cm（L）</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">生地・レース：ナイロン、ポリウレタン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">※タンブラー乾燥はお避け下さい。</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国製</font></td></tr></table><!--ab--><!--ab2015.6--><style type="text/css">
